import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className='container' style={{width:"100vw", height:"10vh",backgroundColor:"red"}}>
        </div>
        <Somediv />
      </header>
    </div>
  );
}
function Somediv(){
  return(
    <div className='container mt-' style={{width:"100vw", height:"20vh",backgroundColor:"yellow"}}>
    </div>
  );
}
export default App;
